import { IComponentData } from "../../../../core/components/assetloader/json/interfaces/icomponent_data";
import { IComponentSerialize } from "../../../../core/components/assetloader/json/interfaces/icomponent_serialize";
import { IComponentDeserialize } from "../../../../core/components/assetloader/json/interfaces/icomponent_deserialize";
import { Vector2 } from "../../../../utility/math_extended/vector2";


export class PhysicsOptions implements IComponentData, IComponentSerialize, IComponentDeserialize{
    
    public name: string;

    //for the body definition
    public rotation: number = 0;
    public gravityScale: number = 1;
    public isRotationFixed: boolean = false;
    public angularDamping: number = 0
    public angularVelocity: number = 0;
    public linearDamping: number = 0;
    public linearVelocity: Vector2 = new Vector2();

    public densityValues: number[];
    public frictionValues: number[];
    public resitutionValues: number[];

    constructor(name: string, amountOfFixtures:number = 1, defaultDensity:number = 1, defaultFriction:number = 0.5, defaultResitution:number = 0.2){
        this.name = name;
        this.densityValues = new Array<number>(amountOfFixtures);
        this.frictionValues = new Array<number>(amountOfFixtures);
        this.resitutionValues = new Array<number>(amountOfFixtures);

        for(let i = 0; i < amountOfFixtures; i++){
            this.densityValues[i] = defaultDensity;
            this.frictionValues[i] =  defaultFriction;
            this.resitutionValues[i] = defaultResitution;
        }
    }

    Serialize(): Map<string, string> {
        let data: Map<string, string> = new Map();
        data.set("rotation",this.rotation.toString())
        data.set("gravityScale",this.gravityScale.toString())
        data.set("isRotationFixed",this.isRotationFixed.toString())
        data.set("angularDamping",this.angularDamping.toString())
        data.set("angularVelocity",this.angularVelocity.toString())
        data.set("lineralDamping",this.linearDamping.toString())
        data.set("linearVelocity", this.linearVelocity.toString());
        data.set("densityValue",this.densityValues.toString());
        data.set("frictionValues",this.frictionValues.toString());
        data.set("resitutionValues",this.resitutionValues.toString());
        return data;
    }
    
    Deserialize(data: Map<string, string>): void {
        this.rotation = parseFloat(data.get("rotation")!);
        this.gravityScale = parseFloat(data.get("gravityScale")!);
        this.isRotationFixed = JSON.parse(data.get("isRotationFixed")!);
        this.angularDamping = parseFloat(data.get("angularDamping")!);
        this.angularVelocity = parseFloat(data.get("angularVelocity")!);
        this.linearDamping = parseFloat(data.get("lineralDamping")!);
        this.linearVelocity.fromString(data.get("linearVelocity")!);
        this.densityValues =  data.get("densityValue")!.split(",").map(Number);
        this.frictionValues =  data.get("frictionValues")!.split(",").map(Number);
        this.resitutionValues =  data.get("frictionValues")!.split(",").map(Number);
    }

    GetCopy(): PhysicsOptions {
        let dataCopy: PhysicsOptions = new PhysicsOptions(this.name);
        dataCopy.rotation = this.rotation;
        dataCopy.gravityScale = this.gravityScale;
        dataCopy.isRotationFixed = this.isRotationFixed;
        dataCopy.angularDamping = this.angularDamping;
        dataCopy.angularVelocity = this.angularVelocity;
        dataCopy.linearDamping = this.angularDamping
        dataCopy.linearVelocity = this.linearVelocity;
        dataCopy.densityValues = this.densityValues;
        dataCopy.frictionValues = this.frictionValues;
        dataCopy.resitutionValues = this.resitutionValues;
        return dataCopy;
    }
}
